import React, {useState, useEffect} from "react";// {useState}
import GameSection from "./GameSection";


function App() {

    const [randFour, setRandFour] = useState("");
    useEffect(() => {
      fetch("http://localhost:8000/message")
        .then((res) => res.json())
        .then((data) => setRandFour(data.randFour));
    }, []);

    let numbers = randFour
    return (

        <div>
            <h1>This is 24</h1>
            <GameSection randNumbers = {numbers} id = {1}/>
            <h1>{randFour}</h1>
        </div>
    );
}

export default App;
